import { random } from "../random"

export class files {
  static image(): string {
    return random.item([
      "data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACwAAAAAAQABAAACAkQBADs=",
      "data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw==",
      "data:image/gif;base64,R0lGODlhAQABAAAAACwAAAAAAQABAAA=",
      "data:image/gif;base64,R0lGODlhAQABAAAAACw=",
      "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAAAAAA6fptVAAAACklEQVQYV2P4DwABAQEAWk1v8QAAAABJRU5ErkJggg==",
      "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAQAAAC1HAwCAAAAC0lEQVQYV2NgYAAAAAMAAWgmWQ0AAAAASUVORK5CYII=",
    ])
  }

  static video(): string {
    return random.item([
      "data:video/webm;base64,",
      "data:video/ogg;base64,",
      "data:video/mp4;base64,",
    ])
  }

  static audio(): string {
    return random.item([
      "data:audio/wav;base64,",
      "data:audio/ogg;base64,",
      "data:audio/mpeg;base64,",
    ])
  }

  static webvtt(): string {
    return random.item([
      // 'data:text/vtt,' + encodeURIComponent('WEBVTT\n\n00:00:00.000 --> 00:00:00.001\ntest');,
      "media/video/sample.vtt",
      // Todo: load from filesystem randomly: 'media/videos/*.{vtt}'
    ])
  }

  static any(): string {
    switch (random.number(3)) {
      case 0:
        return files.image()
      case 1:
        return files.video()
      default:
        return files.audio()
    }
  }
}
